class ResultsGen
{
    results = [];
    fuzzysortOpts = {
        keys: ["title"],
        threshold: -400, // Don't return matches worse than this (higher is faster)
        limit: Infinity, // Don't return more results than this (lower is faster)
        all: false // If true, returns all results for an empty search
    };

    updateResults(query)
    {
        this.results = fuzzysort.go(query, data, this.fuzzysortOpts);

        let resultsContainer = document.getElementById('results');
        resultsContainer.innerHTML = "";

        let queryHead = document.getElementById('query-show');
        queryHead.innerHTML = "Found " + this.results.length + " results";

        for (let result of this.results)
        {
            let link = document.createElement('a');
            link.href = result.obj.href;
            link.innerText = result.obj.title;

            resultsContainer.appendChild(link);
            resultsContainer.appendChild(document.createElement('br'));
        }
    }
};

// 'Entry point'
window.onload = () =>
{
    let resultsGen = new ResultsGen();

    let searchTag = document.getElementById('searchbar');
    searchTag.focus();

    document.onkeyup = (event) =>
    {
        switch (event.key)
        {
            case '/': searchTag.focus(); break;
        }
    };
    searchTag.onkeyup = (event) =>
    {
        if (event.key == 'Enter')
        {
            var url = resultsGen.results[0].obj.href;
            window.open(url, '_blank');
        }
        resultsGen.updateResults(searchTag.value);
    };

    let params = new URLSearchParams(new URL(window.location.href).search);
    let query = params.get('q');
    if (query != null)
    {
        resultsGen.updateResults(query);
        searchTag.value = query;
    }
};

